import React, { Component } from 'react';

class About extends Component {
    render() {
        return(
            <div className="aboutme-div">
                <h1 className="aboutme-header">About Me</h1>
                <body className="aboutme-body">Greetings! I really enjoy learning new languages and frameworks that can help boost my skillsets.
                Without any formal learning on React or Javascript I am creating this webpage to serve as my playground. 
                </body>
            </div>
        )
    }
}

export default About;
